let transactionID = 0x1f;

let vLedNames = ["Logo", "Scrollwheel", "UnderLeft1", "UnderLeft2", "UnderLeft3", "UnderLeft4", "UnderBottom", "UnderRight1", "UnderRight2", "UnderRight3", "UnderRight4"];
