export function Initialize()
{
	device.set_endpoint(3,0x0001,0x000c);

	getDeviceMode();
	getDeviceFirmwareVersion();
	getDeviceSerial();

	if(DpiControl)
	{
		DPIStageControl();
	}

	setDevicePollingRate();
	setDeviceLOD();
	setDeviceScrollMode();
	setDeviceScrollAccel();
	setDeviceSmartReel();
}

export function Render() 
{
	setDeviceColor();

	detectInputs();
}

